343983,\"height\":89.40592393133625,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:1.125em\\\">When we drive at a high speed, we reach our destination in less time than when we drive slowly, even though we are covering the same distance.</span></p>\\n\\n<ul>\\n\\t<li><strong><span style=\\\"font-size:1.125em\\\">This means that speed and time are inversely proportional to each other.</span></strong></li>\\n</ul>\\n\\n<p><span style=\\\"font-size:1.125em\\\">On the other hand, a moving body which covers a higher distance than another during the same interval of time has a higher speed.Â </span></p>\\n\\n<ul>\\n\\t<li><strong><span style=\\\"font-size:1.125em\\\">This means that speed and distance are proportional to each other.</span></strong></li>\\n</ul>\\n\\n<p>Therefore,</p>\\n\\n<ul>\\n\\t<li>\\n\\t<h2><strong>\\\\(V\\\\) = \\\\(\\\\frac{d}{t}\\\\) =&gt; \\\\(d\\\\) = \\\\(V\\\\) x \\\\(t\\\\) =&gt; \\\\(t\\\\) = \\\\(\\\\frac{d}{V}\\\\)</strong></h2>\\n\\t</li>\\n\\t<li>The SI unit of speed is m/s. Another common unit is km/h.</li>\\n</ul>\\n\"},\"subContentId\":\"7e3165ed-c2fc-4808-b0b9-b96e1c00014a\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":38.523274478330656,\"y\":3.1706675206331187,\"width\":40,\"height\":40,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3><strong>Speed vs Velocity</strong></h3>\\n\"},\"subContentId\":\"86e07034-f7e6-4c11-9bb4-997e9432fbb4\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.6051364365971106,\"y\":15.843445120501217,\"width\":52.96950240770465,\"height\":44.38934528886366,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<ul>\\n\\t<li>\\n\\t<p><span style=\\\"font-size:1.25em\\\">Velocity takes the direction of motion into consideration, while speed does not.</span></p>\\n\\t</li>\\n\\t<li>\\n\\t<p><span style=\\\"font-size:1.25em\\\">Because the direction is important, velocity uses displacement instead of distance which is used in speed.</span></p>\\n\\t</li>\\n</ul>\\n\"},\"subContentId\":\"22a8b650-73bc-479d-8b61-a61178b14256\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":56.5008025682183,\"y\":25.36534016506495,\"width\":41.03932418234246,\"height\":57.072015371396134,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAjsAAAGSCAYAAAAFLQDgAAAAAXNSR0ICQMB9xQAAAAlwSFlzAAAXEgAAFxIBZ5/SUgAAABl0RVh0U29mdHdhcmUATWljcm9zb2Z0IE9mZmljZX/tNXEAAFlPSURBVHja7b0LfBxnfagtLqVqTw8oLaEKwdZ6nTjyWlopOATFkmw5BKrTwod6PjhVWwI6tBRRKFXLTVyzTpxIWa0lKzehJJt1nIsSh0aUnFOVz3FUoKBSKCokRoQQFAhBQABxV0to3m/euWhnR3Pd6+zuw+/3/Ey0t9mZ2Z1n/+//0nDo0KEGAAAAgFqFnQAAAADIDgAAAACyAwAAAIDsAAAAACA7AAAAAMgOAAAAALIDAAAAyA47AQAAAJAdAAAAAGQHAAAAANkBAAAAQHYAAAAAkB0AAAAAZAcAAACQHXYCAAAAIDsAAAAAyA4AAAAAsgMAAACA7AAAAAAgOwAAAADIDgAAACA77AQAAABAdgAAAACQHQAAAABkBwAAAADZAQAAAEB2AAAAAJAdAAAAQHYAAAAAkB0AAAAAZAcAAAAA2QEAAABAdgAAAACQHQAACCenIm1DpyId8/dH4msPRNoXT0Xax05GY83sG0B2AACgqjkZjTYqojN3KhIXVhTx2VD+Tcj7sK8A2QEAgKrEEB1FbJZPRs7vk9Ec+e8DkfYFQ3rk/2dfAbIDAABVh5QaTXTaV09G9zZtFaGOjC48o+wvQHYAAKDqUCRmSpeZEScRknk87CtAdgAAoCrREpHjQoqN+e+L0b2R+yPt68ptK3YR ary\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Speed is of two types: instantaneous speed and average speed.</p>\\n\\n<ul>\\n\\t<li><strong>Instantaneous speed</strong>Â is the speed of a moving body at a <strong>particular instant </strong>of <strong>time</strong>. For example, the <strong>speedometer </strong>of a car displays its instantaneous speed. The instantaneous speed can change as time goes by. A car can go faster and slower, maybe even stops at lights.</li>\\n\\t<li>\\n\\t<p><strong>Average speed</strong>Â  measures the distance a moving body travels over a period of time (duration). For example, the average speed of a plane from Beirut to Cairo is the distance covered by that plane over the duration of the whole trip.</p>\\n\\t</li>\\n</ul>\\n\"},\"subContentId\":\"c2f0c41f-1d08-4f06-b2bf-cb69839bbc53\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":24.07704654895666,\"y\":3.1706675206331187,\"width\":52.83916532905297,\"height\":9.507056320567168,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3><strong>Instantaneous Speed vs Average Speed</strong></h3>\\n\"},\"subContentId\":\"2ba64e5d-3c90-4372-a930-8081d239ece2\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":71.26805778491172,\"y\":60.24268289202926,\"width\":27.686035313001604,\"height\":38.67231468241008,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAZMAAAEdCAIAAABGx
